import React, { useState } from 'react';
import styles from './StyleSelector.module.css';

const profileImages = [
  { id: 1, image: process.env.PUBLIC_URL + '/assets1/profiles/profile1.png' },
  { id: 2, image: process.env.PUBLIC_URL + '/assets1/profiles/profile2.png' },
  { id: 3, image: process.env.PUBLIC_URL + '/assets1/profiles/profile3.png' },
  { id: 4, image: process.env.PUBLIC_URL + '/assets1/profiles/profile4.png' },
  { id: 5, image: process.env.PUBLIC_URL + '/assets1/profiles/profile5.png' },
  { id: 6, image: process.env.PUBLIC_URL + '/assets1/profiles/profile6.png' },
  { id: 7, image: process.env.PUBLIC_URL + '/assets1/profiles/profile7.png' }
];

const styleOptions = [
  { id: 1, name: 'Basic jumpers' },
  { id: 2, name: 'Warm puffer' },
  { id: 3, name: 'Bomber' },
  { id: 4, name: 'Biker jacket' }
];

const tools = [
  { id: 'camera', icon: '📸' },
  { id: 'layers', icon: '🗂️' },
  { id: 'grid', icon: '📱' },
  { id: 'layout', icon: '📐' },
  { id: 'wallet', icon: '👛' },
  { id: 'close', icon: '❌' }
];

export default function StyleSelector({ onClose }) {
  const [selectedProfile, setSelectedProfile] = useState(null);
  const [selectedStyle, setSelectedStyle] = useState(1); // Default to Basic jumpers

  const handleProfileClick = (profileId) => {
    setSelectedProfile(profileId);
  };

  const handleStyleClick = (styleId) => {
    setSelectedStyle(styleId);
  };

  return (
    <div className={styles.container}>
      {/* Star icon in top left */}
      <div style={{ position: 'absolute', top: 20, left: 20, fontSize: '24px' }}>
        ✨
      </div>

      {/* Heart icon in top right */}
      <div style={{ position: 'absolute', top: 20, right: 20, fontSize: '24px', cursor: 'pointer' }}>
        🤍
      </div>

      {/* Top profile circles */}
      <div className={styles.profileCircles}>
        {profileImages.map((profile) => (
          <div 
            key={profile.id} 
            className={`${styles.profileCircle} ${selectedProfile === profile.id ? styles.selected : ''}`}
            onClick={() => handleProfileClick(profile.id)}
          >
            <img 
              src={profile.image} 
              alt={`Profile ${profile.id}`}
              onError={(e) => {
                e.target.src = '/images/placeholder.png';
                e.target.onerror = null;
              }}
            />
          </div>
        ))}
      </div>

      {/* Main content */}
      <div className={styles.mainContent}>
        <div className={styles.imageWrapper}>
          <img 
            src={process.env.PUBLIC_URL + '/assets1/man.png'}
            alt="Style Preview"
            className={styles.mainImage}
            onError={(e) => {
              console.error('Failed to load main image');
              e.target.src = '/images/placeholder.png';
              e.target.onerror = null;
            }}
          />
        </div>
      </div>

      {/* Tools menu */}
      <div className={styles.toolsMenu}>
        {tools.map((tool) => (
          <button 
            key={tool.id}
            className={styles.toolButton}
            onClick={() => tool.id === 'close' && onClose?.()}
          >
            {tool.icon}
          </button>
        ))}
      </div>

      {/* Style options */}
      <div className={styles.styleOptions}>
        {styleOptions.map((style) => (
          <button 
            key={style.id} 
            className={`${styles.styleButton} ${selectedStyle === style.id ? styles.selected : ''}`}
            onClick={() => handleStyleClick(style.id)}
          >
            {style.name}
          </button>
        ))}
      </div>

      {/* Bottom navigation */}
      <div className={styles.bottomNav}>
        <div className={styles.navItem}>
          <span className={styles.navIcon}>👔</span>
          <span>Collar</span>
        </div>
        <div className={`${styles.navItem} ${styles.active}`}>
          <span className={styles.navIcon}>👕</span>
          <span>Styles</span>
        </div>
        <div className={styles.navItem}>
          <span className={styles.navIcon}>👖</span>
          <span>Pant</span>
        </div>
        <div className={styles.navItem}>
          <span className={styles.navIcon}>🧥</span>
          <span>Coat</span>
        </div>
        <div className={styles.navItem}>
          <span className={styles.navIcon}>👜</span>
          <span>Accessories</span>
        </div>
        <div className={styles.navItem}>
          <span className={styles.navIcon}>🔧</span>
          <span>Tools</span>
        </div>
      </div>
    </div>
  );
}
